    <style>
        html {
            font-family: "Source Sans Pro", "Helvetica Neue", "Helvetica", "Arial", sans-serif;
            font-size: 18px;
            letter-spacing: -0.4px;
            line-height: 1.5;
            text-rendering: optimizeLegibility;
        }
        
        h2 {
            color: #002e6d;
            line-height: 1.1;
            margin-bottom: 0.5em;
            margin-top: 0;
        }
        
        input[type="text"] {
            border-radius: 0;
            font-family: inherit;
            font-size: 100%;
            height: 48px;
            line-height: 1.15;
            margin: 0;
            vertical-align: middle;
            width: 30ch;
        }
        
        input[type="submit"] {
            background-color: #007DBC;
            border: 0;
            border-radius: 0;
            color: #ffffff;
            display: inline-block;
            font-style: normal;
            font-weight: 600;
            font-size: 22px;
            height: 54px;
            letter-spacing: 0.6px;
            line-height: 1;
            margin-left: 12px;
            text-transform: uppercase;
            transition: all 150ms ease;
            user-select: none;
            padding: 13px 26px;
            vertical-align: middle;
        }
        
        input[type="submit"]:hover {
            background-color: #58acef;
        }
        
        .container {
            background-color: white;
            border-top: 5px solid #002e6d;
            box-shadow: 0 7px 15px 0 rgba(0, 0, 0, 0.1);
            padding: 50px;
        }
    </style>
</head>
